static double_t const *head[MAX_EXP - MIN_EXP + 1];
static const double_t **pow10 = head - MIN_EXP;

static const double_t neg_1 = 0xBFF0000000000000ul;
static const double_t zero = 0;

static bool initialized = false;

static void initialize() {
    for(int i = MIN_EXP; i <= MAX_EXP; i++) {
        head[i - MIN_EXP] = _val + (i - MIN_EXP) * 10;
    }
}

double_t readDouble(char *const begin, char *const end) {
    if(!initialized) {
        initialized = true;
        initialize();
    }
    char *buff = (char*)malloc(sizeof(char[end - begin + 1]));
    memcpy(buff, begin, sizeof(char[end - begin]));
    buff[end - begin] = 0;

    double_t res = zero;
    char *cur = isdigit(buff[0]) ? buff : buff + 1;
    while(isdigit(*cur)) {
        res = doubleMul(res, pow10[1][1]);
        res = doubleAdd(res, pow10[0][*cur - '0']);
        cur++;
    }
    if(*cur == '.') {
        cur++;
        for(int i = 1; isdigit(*cur); i++, cur++) {
            res = doubleAdd(res, pow10[-i][*cur - '0']);
        }
    }
    if(buff[0] == '-') {
        res = doubleMul(res, neg_1);
    }
    free(buff);
    return res;
}

static double_t const* upper_bound(double_t const *begin, double_t const *end, double_t val) {
    int L = 0, R = end - begin - 1, res = end - begin;
    while(L <= R) {
        int mid = (L + R) >> 1;
        if(begin[mid] > val) res = mid, R = mid - 1;
        else L = mid + 1;
    }
    return begin + res;
}

void printDouble(double_t val) {
    if(!initialized) {
        initialized = true;
        initialize();
    }
    if(doubleCmp(val, zero) == -1) {
        putchar('-');
        val = doubleMul(val, neg_1);
    }
    char buff[MAX_EXP - MIN_EXP + 1];
    char *dgt = buff - MIN_EXP;
    for(int i = MAX_EXP; i >= MIN_EXP; i--) {
        int digit = upper_bound(pow10[i], pow10[i] + 10, val) - pow10[i] - 1;
        dgt[i] = '0' + digit;
        val = doubleMin(val, pow10[i][digit]);
    }

    int begin = MAX_EXP, end = MIN_EXP;
    while(begin > 0 && dgt[begin] == '0') {
        begin--;
    }
    while(end < 0 && dgt[end] == '0') {
        end++;
    }
    for(int i = begin; i >= 0; i--) {
        putchar(dgt[i]);
    }
    if(end < 0) {
        putchar('.');
        for(int i = -1; i >= end; i--) {
            putchar(dgt[i]);
        }
    }
    putchar('\n');
}

